import { Routes, Route } from "react-router-dom";
import QuizzesPage from "./pages/QuizzesPage";
import PythonQuizzes from "./pages/PythonQuizzes";
import JavaScriptQuizzes from "./pages/JavaScriptQuizzes";

function App() {
  return (
    <Routes>
      <Route path="/" element={<QuizzesPage />} />
      <Route path="/python-quizzes" element={<PythonQuizzes />} />
      <Route path="/javascript-quizzes" element={<JavaScriptQuizzes />} />
    </Routes>
  );
}

export default App;
